(214, 214, 1, 'About', '2022-10-10 11:22:00', '2022-10-10 11:22:00', 'dfccdf18-629c-49d0-b402-020496be6cf4', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(215, 215, 1, 'Rectangle 38about', '2022-10-10 11:23:40', '2022-10-10 11:28:42', '03880ae2-29be-4753-adae-ab8d6d6c153e', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(217, 217, 1, 'About', '2022-10-10 11:24:58', '2022-10-10 11:24:58', '9ff8dfcb-cfda-47d1-8d6c-5a3b22354a91', NULL, NULL, '<p>Dear Movie Lovers,</p>\n<p>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</p><figure><img src=\"{asset:215:url||http://localhost/kinoklub/web/img/Rectangle-38about.png}\" alt=\"\" /></figure><p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”<br /><br />Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(219, 219, 1, 'About', '2022-10-10 11:27:04', '2022-10-10 11:27:04', '2202b654-8b54-4442-8f7a-c76bd62935cf', NULL, NULL, '<p><strong>A community of fellow motion picture lovers</strong></p>\n<p><br /></p>\n<p>Dear Movie Lovers,</p>\n<p>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</p>\n<figure><img src=\"{asset:215:url||http://localhost/kinoklub/web/img/Rectangle-38about.png}\" alt=\"\" /></figure><p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”<br /><br />Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
