(293, 293, 1, 'Rectangle 38about', '2022-10-10 12:02:26', '2022-10-10 12:02:26', '440fe84c-9201-41cf-9522-9a591483190c', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(295, 295, 1, 'About', '2022-10-10 12:02:32', '2022-10-10 12:02:32', '582f2fca-ab89-47da-b966-ee38bd160098', NULL, NULL, '<h3>A community of fellow motion picture lovers</h3><p>&nbsp;</p><p>Dear Movie Lovers,</p><p>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</p><p><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\"></p><p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”<br><br>Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br><br>Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(297, 297, 1, 'About', '2022-10-10 12:19:29', '2022-10-10 12:19:29', '201e8f1a-030f-41ab-95c1-ee773cc0326a', NULL, NULL, '<h3>A community of fellow motion picture lovers</h3><p> </p><p>Dear Movie Lovers,</p><p>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</p><p><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\" /></p><p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”<br /><br />Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
