(373, 358, 1, 'KAPA / BEANIE', '2022-10-10 16:05:17', '2022-11-26 09:33:01', 'aefa33cb-d1af-44a0-a513-1a756edc4cdf', NULL, NULL, '<p dir=\"ltr\">Prvi slovenski <strong>božični družinski film, slovenija, 85’’</strong></p>\n\n<p dir=\"ltr\"><strong>Medgeneracijski Center Bled</strong><br /></p>\n\n<figure><iframe style=\"width:500px;height:281px;\" src=\"//www.youtube.com/embed/Wjgt3g9OZVo\" frameborder=\"0\"></iframe></figure>\n<p><br /></p>\n<p dir=\"ltr\">Prvi slovenski božični celovečerni film režiserja Slobodana Maksimovića zgodbo o dečku, ki nima nič, in deklici, ki ima vse, preplete z močno vero v čudeže in jo poveže v topel, humoren in mestoma tudi napet film.</p>\n<p dir=\"ltr\"></p>\n<p dir=\"ltr\">Erik ima devet let in živi v mladinskem domu. Na glavi ves čas nosi kapo. Ko mu je še posebej hudo, si jo povezne kar čez nos. Kapo mu je namreč spletla mama. Ker je Erik tih in zadržan fant, mu v domu ni lahko – nanj se še posebej rada spravlja skupina starejših varovancev. Ko je za božič izžreban, da praznik preživi pri premožni dobrodelni družini, ga to prav nič ne razveseli. Najraje bi šel domov, k staršem. Nad Erikovim božičnim obiskom pa ni prav nič navdušena niti sedemletna Lučka. Ona bi raje deklico, za božič pa kužka. A kljub začetnemu nesoglasju je njun božični večer poseben: ko pri smrečici zalotita Božička, mu brez oklevanja sledita v avto. Erik in Lučka se namesto v posteljo odpravita na pustolovščino po praznično okrašenem mestu. Božična noč obema prinese izpolnitev želja, a ne čisto tako, kot sta pričakovala.</p>\n<p><br /><br /></p>', '2022-12-09 08:00:00', 'MEDGENERACIJSKI CENTER BLED', NULL, 'House and people', '{\"titleRaw\":{\"2\":\"Kino Klub\",\"b5j\":\" | Beach bum on the beach\"},\"descriptionRaw\":\"A community of fellow motion picture lovers. Join us.\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":\"\",\"title\":\"Kino Klub | KAPA / BEANIE\",\"imageId\":\"\",\"description\":\"A community of fellow motion picture lovers. Join us.\"},\"facebook\":{\"handle\":\"\",\"title\":\"Kino Klub | KAPA / BEANIE\",\"imageId\":\"\",\"description\":\"A community of fellow motion picture lovers. Join us.\"}},\"advanced\":{\"robots\":[],\"canonical\":\"\"}}'),
(374, 359, 1, 'Beach bum on the beach', '2022-10-10 16:05:17', '2022-10-10 16:05:17', '1345cb3d-881b-40bc-b2a8-5b8e56dc3f72', NULL, NULL, '<p><strong>Dear Movie Lovers,</strong><br /><br /><strong>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</strong></p>', '2022-12-15 08:00:00', 'KINO RADOLCA', NULL, NULL, NULL),
