(437, 391, 2, 'Home', '2022-10-10 17:04:25', '2022-10-10 17:04:25', '6f8cda60-802a-44bd-9088-e0084db1be04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(438, 392, 1, 'About', '2022-10-10 17:10:30', '2022-10-10 17:10:30', '083afd38-6c82-406d-a8ca-468b35fde47e', 'A community of fellow motion picture lovers', NULL, '<p>Dear Movie Lovers,<br /></p>\n<p>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</p>\n<figure><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\" /></figure><p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”<br /><br />Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>\n<figure><img src=\"{asset:112:url||http://localhost/kinoklub/web/img/bg_2022-10-10-094530_tkwk.jpg}\" alt=\"\" /></figure><h2>Join us, let’s make this big<br /></h2>\n<p>One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
