(504, 425, 2, 'About', '2022-10-10 17:25:08', '2022-10-10 17:25:08', '76cbab82-3f59-4399-910d-f9a81b609436', 'Skupnost ljubiteljev filma', NULL, '<p>Dragi filmoljubi,</p>\n<p><br />Izkazalo se je, da je Christopher Nolan prepričal Caina, da je prevzel vlogo Alfreda Pennywortha, tako da se je pojavil v njegovi hiši. Med pogovorom z Aubrey Plaza za revijo Interview Magazine je igralec razpravljal o pogovoru, ki je pripeljal do njunega uspešnega partnerstva. Igralec je izjavil, da je bil nekega nedeljskega jutra doma, ko je pozvonilo na vratih. Ko je Caine odprl vrata, se je zgodilo tole:</p>\n<p></p>\n<figure><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\" /></figure><p>\"Tam je stal moški s scenarijem v roki. Pomislil sem, \'To mora biti režiser.\' Rekel sem, \'Kako ti je ime?\' Rekel je: \'To je Christopher Nolan.\' Takoj sem poznal njegovo ime, ker je posnel tri briljantne filme, a so bili majhni. In pomislil sem: \"Oh, to je super. Prosil me bo za enega od teh majhnih filmov in to bo fantastično.\" \' In potem sem rekel: \'Vstopi\' in mu dal skodelico čaja. Rekel sem: \'Kaj je film?\' In rekel je: \'Imenuje se Batman Begins.\' Mislil sem si: \"Prestar sem, da bi igral Batmana, zato sem verjetno butler.\"<br /><br />Seveda je imel Nolan prav. Alfred je veliko več kot butler Brucea Wayna, saj igra pomembno vlogo v stripih o Batmanu, ki se je z leti samo razširila. Kot mnogi komični liki je bila tudi njegova zgodovina kar nekajkrat omenjena, a Alfred je že dolgo nadomestni oče ne samo Bruceu, ampak tudi vsem, ki so prevzeli plašč Robina. Je neprecenljiv član družine Bat-Family in iskreno povedano, brez njega bi bili vsi izgubljeni. Pravzaprav je DC Comics pred nekaj leti videl Alfreda, ki ga je umoril Bane, in zagotovo so bili. Eden najbolj pretresljivih trenutkov neverjetne serije \"Nightwing\" Toma Taylorja in Bruna Redonda je Dick Grayson, ki bere Alfredovo pismo po tem, ko je butler umrl. Če ne sledite tej knjigi, takoj pojdite ven in popravite to! Kar zadeva Alfreda, bo le čas pokazal svoje, a vsi vemo, da v stripih nihče zares ne ostane mrtev.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>\n<figure><img src=\"{asset:112:url||http://localhost/kinoklub/web/img/bg_2022-10-10-094530_tkwk.jpg}\" alt=\"\" /></figure><h2>Pridružite se nam, naredimo to veliko</h2>\n<p>Eden najbolj pretresljivih trenutkov neverjetne serije \"Nightwing\" Toma Taylorja in Bruna Redonda je Dick Grayson, ki bere Alfredovo pismo po smrti butlerja. Če ne sledite tej knjigi, takoj pojdite ven in popravite to! Kar zadeva Alfreda, bo le čas pokazal svoje, a vsi vemo, da v stripih nihče zares ne ostane mrtev. </p>\n<p>Preberi več</p>\n<p> <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(505, 425, 1, 'About', '2022-10-10 17:25:08', '2022-10-10 17:25:08', 'ba7be4a4-ff93-4777-a5b3-c3f3a042a3bc', 'A community of fellow motion picture lovers', NULL, '<p>Dear Movie Lovers,<br /></p>\n<p>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</p>\n<figure><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\" /></figure><p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”<br /><br />Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>\n<figure><img src=\"{asset:112:url||http://localhost/kinoklub/web/img/bg_2022-10-10-094530_tkwk.jpg}\" alt=\"\" /></figure><h2>Join us, let’s make this big<br /></h2>\n<p>One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(508, 427, 2, 'Projects', '2022-10-10 17:25:24', '2022-10-10 17:25:24', '1eaa605a-0531-4c36-bc0e-251ec8c47462', 'Projekti', NULL, '<p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”</p>\n<p>Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.</p>\n<p>Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(509, 427, 1, 'Projects', '2022-10-10 17:25:24', '2022-10-10 17:25:24', '65291ed5-d473-431a-b921-5d0cf5ff3b3a', 'Projects', NULL, '<p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”</p>\n<p>Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.</p>\n<p>Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(512, 429, 2, 'Projects', '2022-10-10 17:26:16', '2022-10-10 17:26:16', '775ba260-7572-4468-ba49-3682ed8c7de7', 'Projekti', NULL, '<p>\"Tam je stal moški s scenarijem v roki. Pomislil sem, \'To mora biti režiser.\' Rekel sem, \'Kako ti je ime?\' Rekel je: \'To je Christopher Nolan.\' Takoj sem poznal njegovo ime, ker je posnel tri briljantne filme, a so bili majhni. In pomislil sem: \"Oh, to je super. Prosil me bo za enega od teh majhnih filmov in to bo fantastično.\" \' In potem sem rekel: \'Vstopi\' in mu dal skodelico čaja. Rekel sem: \'Kaj je film?\' In rekel je: \'Imenuje se Batman Begins.\' Mislil sem si: \"Prestar sem, da bi igral Batmana, zato sem verjetno butler.\"</p>\n<p>Seveda je imel Nolan prav. Alfred je veliko več kot butler Brucea Wayna, saj igra pomembno vlogo v stripih o Batmanu, ki se je z leti samo razširila. Kot mnogi komični liki je bila tudi njegova zgodovina kar nekajkrat omenjena, a Alfred je že dolgo nadomestni oče ne samo Bruceu, ampak tudi vsem, ki so prevzeli plašč Robina. Je neprecenljiv član družine Bat-Family in iskreno povedano, brez njega bi bili vsi izgubljeni. Pravzaprav je DC Comics pred nekaj leti videl Alfreda, ki ga je umoril Bane, in zagotovo so bili. Eden najbolj pretresljivih trenutkov neverjetne serije \"Nightwing\" Toma Taylorja in Bruna Redonda je Dick Grayson, ki bere Alfredovo pismo po tem, ko je butler umrl. Če ne sledite tej knjigi, takoj pojdite ven in popravite to! Kar zadeva Alfreda, bo le čas pokazal svoje, a vsi vemo, da v stripih nihče zares ne ostane mrtev.</p>\n<p>Preberi več: <a href=\"https://www.slashfilm.com/9433\">https://www.slashfilm.com/9433</a>...</p>', NULL, NULL, NULL, NULL, NULL),
(513, 429, 1, 'Projects', '2022-10-10 17:26:16', '2022-10-10 17:26:16', 'e4a87955-c98c-48fb-b94f-b13374805074', 'Projects', NULL, '<p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”</p>\n<p>Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.</p>\n<p>Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(514, 430, 2, 'About', '2022-10-10 17:50:28', '2022-10-10 17:50:28', '36160852-207b-4108-943a-684e6537aad8', 'Skupnost ljubiteljev filma', NULL, '<p>Dragi filmoljubi,</p>\n<p><br />Izkazalo se je, da je Christopher Nolan prepričal Caina, da je prevzel vlogo Alfreda Pennywortha, tako da se je pojavil v njegovi hiši. Med pogovorom z Aubrey Plaza za revijo Interview Magazine je igralec razpravljal o pogovoru, ki je pripeljal do njunega uspešnega partnerstva. Igralec je izjavil, da je bil nekega nedeljskega jutra doma, ko je pozvonilo na vratih. Ko je Caine odprl vrata, se je zgodilo tole:</p>\n<p></p>\n<figure><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\" /></figure><p>\"Tam je stal moški s scenarijem v roki. Pomislil sem, \'To mora biti režiser.\' Rekel sem, \'Kako ti je ime?\' Rekel je: \'To je Christopher Nolan.\' Takoj sem poznal njegovo ime, ker je posnel tri briljantne filme, a so bili majhni. In pomislil sem: \"Oh, to je super. Prosil me bo za enega od teh majhnih filmov in to bo fantastično.\" \' In potem sem rekel: \'Vstopi\' in mu dal skodelico čaja. Rekel sem: \'Kaj je film?\' In rekel je: \'Imenuje se Batman Begins.\' Mislil sem si: \"Prestar sem, da bi igral Batmana, zato sem verjetno butler.\"<br /><br />Seveda je imel Nolan prav. Alfred je veliko več kot butler Brucea Wayna, saj igra pomembno vlogo v stripih o Batmanu, ki se je z leti samo razširila. Kot mnogi komični liki je bila tudi njegova zgodovina kar nekajkrat omenjena, a Alfred je že dolgo nadomestni oče ne samo Bruceu, ampak tudi vsem, ki so prevzeli plašč Robina. Je neprecenljiv član družine Bat-Family in iskreno povedano, brez njega bi bili vsi izgubljeni. Pravzaprav je DC Comics pred nekaj leti videl Alfreda, ki ga je umoril Bane, in zagotovo so bili. Eden najbolj pretresljivih trenutkov neverjetne serije \"Nightwing\" Toma Taylorja in Bruna Redonda je Dick Grayson, ki bere Alfredovo pismo po tem, ko je butler umrl. Če ne sledite tej knjigi, takoj pojdite ven in popravite to! Kar zadeva Alfreda, bo le čas pokazal svoje, a vsi vemo, da v stripih nihče zares ne ostane mrtev.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>\n<figure><img src=\"{asset:112:url||http://localhost/kinoklub/web/img/bg_2022-10-10-094530_tkwk.jpg}\" alt=\"\" /></figure><h2>Pridružite se nam, naredimo to veliko</h2>\n<p>Eden najbolj pretresljivih trenutkov neverjetne serije \"Nightwing\" Toma Taylorja in Bruna Redonda je Dick Grayson, ki bere Alfredovo pismo po smrti butlerja. Če ne sledite tej knjigi, takoj pojdite ven in popravite to! Kar zadeva Alfreda, bo le čas pokazal svoje, a vsi vemo, da v stripih nihče zares ne ostane mrtev. </p>\n<p>Preberi več</p>\n<p> <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(515, 430, 1, 'About', '2022-10-10 17:50:28', '2022-10-10 17:50:28', 'f43d3f10-5edd-4d25-9fd2-aaa3aed506bd', 'A community of fellow motion picture lovers', NULL, '<p>Dear Movie Lovers,<br /></p>\n<p>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</p>\n<figure><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\" /></figure><p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”<br /><br />Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>\n<figure><img src=\"{asset:112:url||http://localhost/kinoklub/web/img/bg_2022-10-10-094530_tkwk.jpg}\" alt=\"\" /></figure><h2>Join us, let’s make this big<br /></h2>\n<p>One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL);
