hey certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>\n<figure><img src=\"{asset:112:url||https://beta.kinoklub.si/img/bg_2022-10-10-094530_tkwk.jpg}\" alt=\"\" /></figure>\n<h2>Join us, let’s make this big<br /></h2>\n<p>One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, '{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":\"\",\"title\":\"Kino Klub | About\",\"imageId\":null,\"description\":\"A community of fellow motion picture lovers. Join us.\"},\"facebook\":{\"handle\":\"\",\"title\":\"Kino Klub | About\",\"imageId\":null,\"description\":\"A community of fellow motion picture lovers. Join us.\"}},\"advanced\":{\"robots\":[\"noindex\"],\"canonical\":null}}'),
