(742, 544, 2, 'WOLF KINO x KK', '2022-11-26 09:50:13', '2022-11-26 10:03:41', '91946d9d-f445-403b-a31c-cf2cbbe45301', NULL, 'ARTICLES', '<p dir=\"ltr\">Ko so se prejšnjo pomlad začeli diktatorski ukrepi umirjati in sem se odločal kam lahko zdaj končno grem, je bilo brez dvoma na vrhu seznama mesto zloglasnih umazanih zabav, razvpitih umetnosti in \'\'easy going\'\' življena - Berlin. <br /></p>\n\n<p dir=\"ltr\">Odločitev je padla. Poleg tega, da sem se veselil prešvicane ekstravagance v Berghainu in prijateljevega arhitekturnega expota sem šel tja tudi z namenom, da raziščem alternativno lokalno kino kulturo.</p>\n<p dir=\"ltr\"> S prijaznim mailom v stilu nadvse navdušenega mladega ustvarjalca, ki želi raziskati vse kar je možno, sem predstavil Kino Klub vizijo in zakaj bi bilo dobro sodelovati. Navdušeni so bili.<br /></p>\n\n<p>Wolf Kino je že v sami osnovi nastal v sodelovanju s filmski ustvarjalci ter podporniki kulture in tako nadaljuje svoje delovanju vse do danes. Razne filmske delavnice in debate so redni del njihovega programa, kar je bilo za naš kolektiv nadvse zanimivo, saj imamo pravzaprav podobno vizijo - približati filmsko kulturo vsem.</p>\n<p>Ena izmed njihovih programskih dejavnosti je tudi ‘’WOLF OPEN SCREEN’’, kjer imajo mali ustvarjalci možnost, da pokažejo svoje kratke filmske izdelke in o njih debatirajo. Svetovi so se povezali in odprla se je krasna priložnost za sodelovanje z našim mini festivalom kratkih KURZ KLUB.</p>\n<p>Za polno izkušnjo bom v zaključku skočil nekaj dni naprej, ko sem kino obiskal kot redni obiskovalec, si privoščil kokice in pivo, ter si ogledal film ‘’The worst person in the world’’. Intimna velikost dvorane in hladno pivo v roki sta me skoraj prepričala, da je to najboljši kino, ki sem ga obiskal do sedaj… seveda pa sem se takoj spomnil na teksaški Alamo draft house, kjer s pritiskom na gumb do svojega dvoranskega fotelja dobiš full-service postrežbo, a o tem kdaj drugič.</p>', NULL, NULL, NULL, 'wolf kino berlin', '{\"titleRaw\":{\"2\":\"Kino Klub\",\"b5j\":\" | \"},\"descriptionRaw\":\"A community of fellow motion picture lovers. Join us.\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":\"\",\"title\":\"Kino Klub | WOLF KINO x KK\",\"imageId\":\"\",\"description\":\"A community of fellow motion picture lovers. Join us.\"},\"facebook\":{\"handle\":\"\",\"title\":\"Kino Klub | WOLF KINO x KK\",\"imageId\":\"\",\"description\":\"A community of fellow motion picture lovers. Join us.\"}},\"advanced\":{\"robots\":[],\"canonical\":\"\"}}'),
