itleRaw\":{\"2\":\"Kino Klub\",\"b5j\":\" | \"},\"descriptionRaw\":\"A community of fellow motion picture lovers. Join us.\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":\"\",\"title\":\"Kino Klub | WOLF KINO x KK\",\"imageId\":\"\",\"description\":\"A community of fellow motion picture lovers. Join us.\"},\"facebook\":{\"handle\":\"\",\"title\":\"Kino Klub | WOLF KINO x KK\",\"imageId\":\"\",\"description\":\"A community of fellow motion picture lovers. Join us.\"}},\"advanced\":{\"robots\":[],\"canonical\":\"\"}}'),
(776, 561, 1, 'About', '2022-11-26 14:05:11', '2022-12-10 19:31:46', '51b71dcc-adc9-4d0d-996d-6b6c4e38591c', 'A community of fellow motion picture lovers', NULL, '<p>Dear Movie Lovers,<br /></p>\n<p>It turns out Christopher Nolan convinced Caine to take the role of Alfred Pennyworth by showing up at his house. During a conversation with Aubrey Plaza for Interview Magazine, the actor discussed the talk that led to their prosperous partnership. The actor stated he was at his house one Sunday morning when the doorbell rang. After Caine answered the door, here\'s what happened:</p>\n<p></p>\n<figure><img src=\"{asset:276:url||https://beta.kinoklub.si/img/Rectangle-43stabley_2022-10-10-120007_fdse.png}\" alt=\"\" /></figure>\n<figure><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\" /></figure>\n<p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”<br /><br />Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>\n<figure><img src=\"{asset:112:url||https://beta.kinoklub.si/img/bg_2022-10-10-094530_tkwk.jpg}\" alt=\"\" /></figure>\n<h2>Join us, let’s make this big<br /></h2>\n<p>One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, '{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":\"\",\"title\":\"Kino Klub | About\",\"imageId\":null,\"description\":\"A community of fellow motion picture lovers. Join us.\"},\"facebook\":{\"handle\":\"\",\"title\":\"Kino Klub | About\",\"imageId\":null,\"description\":\"A community of fellow motion picture lovers. Join us.\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),
(777, 561, 2, 'About', '2022-11-26 14:05:11', '2022-12-10 19:31:46', 'd50b2a5e-7594-4536-afce-9b2b631aa263', 'LJUBITELJI FILMA', NULL, '<p>Dragi filmoljubi,</p>\n<p><br />Izkazalo se je, da je Christopher Nolan prepričal Caina, da je prevzel vlogo Alfreda Pennywortha, tako da se je pojavil v njegovi hiši. Med pogovorom z Aubrey Plaza za revijo Interview Magazine je igralec razpravljal o pogovoru, ki je pripeljal do njunega uspešnega partnerstva. Igralec je izjavil, da je bil nekega nedeljskega jutra doma, ko je pozvonilo na vratih. Ko je Caine odprl vrata, se je zgodilo tole:</p>\n<p></p>\n<figure><img src=\"{asset:276:url||https://beta.kinoklub.si/img/Rectangle-43stabley_2022-10-10-120007_fdse.png}\" alt=\"\" /></figure>\n<figure><img src=\"http://localhost/kinoklub/web/img/Rectangle-38about.png?1665401294431?1665401322956#asset:215\" alt=\"\" /></figure>\n<p>\"Tam je stal moški s scenarijem v roki. Pomislil sem, \'To mora biti režiser.\' Rekel sem, \'Kako ti je ime?\' Rekel je: \'To je Christopher Nolan.\' Takoj sem poznal njegovo ime, ker je posnel tri briljantne filme, a so bili majhni. In pomislil sem: \"Oh, to je super. Prosil me bo za enega od teh majhnih filmov in to bo fantastično.\" \' In potem sem rekel: \'Vstopi\' in mu dal skodelico čaja. Rekel sem: \'Kaj je film?\' In rekel je: \'Imenuje se Batman Begins.\' Mislil sem si: \"Prestar sem, da bi igral Batmana, zato sem verjetno butler.\"<br /><br />Seveda je imel Nolan prav. Alfred je veliko več kot butler Brucea Wayna, saj igra pomembno vlogo v stripih o Batmanu, ki se je z leti samo razširila. Kot mnogi komični liki je bila tudi njegova zgodovina kar nekajkrat omenjena, a Alfred je že dolgo nadomestni oče ne samo Bruceu, ampak tudi vsem, ki so prevzeli plašč Robina. Je neprecenljiv član družine Bat-Family in iskreno povedano, brez njega bi bili vsi izgubljeni. Pravzaprav je DC Comics pred nekaj leti videl Alfreda, ki ga je umoril Bane, in zagotovo so bili. Eden najbolj pretresljivih trenutkov neverjetne serije \"Nightwing\" Toma Taylorja in Bruna Redonda je Dick Grayson, ki bere Alfredovo pismo po tem, ko je butler umrl. Če ne sledite tej knjigi, takoj pojdite ven in popravite to! Kar zadeva Alfreda, bo le čas pokazal svoje, a vsi vemo, da v stripih nihče zares ne ostane mrtev.<br /><br />Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>\n<figure><img src=\"{asset:112:url||https://beta.kinoklub.si/img/bg_2022-10-10-094530_tkwk.jpg}\" alt=\"\" /></figure>\n<h2>Pridružite se nam, naredimo to veliko</h2>\n<p>Eden najbolj pretresljivih trenutkov neverjetne serije \"Nightwing\" Toma Taylorja in Bruna Redonda je Dick Grayson, ki bere Alfredovo pismo po smrti butlerja. Če ne sledite tej knjigi, takoj pojdite ven in popravite to! Kar zadeva Alfreda, bo le čas pokazal svoje, a vsi vemo, da v stripih nihče zares ne ostane mrtev. </p>\n<p>Preberi več</p>\n<p> <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, '{\"titleRaw\":{\"b5j\":\" | About\"},\"descriptionRaw\":\"A community of fellow motion picture lovers. Join us.\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":\"\",\"title\":\"| About\",\"imageId\":\"\",\"description\":\"A community of fellow motion picture lovers. Join us.\"},\"facebook\":{\"handle\":\"\",\"title\":\"| About\",\"imageId\":\"\",\"description\":\"A community of fellow motion picture lovers. Join us.\"}},\"advanced\":{\"robots\":[\"noindex\"],\"canonical\":\"\"}}'),
