(803, 575, 1, 'Projects', '2022-11-26 18:40:17', '2022-11-26 18:40:17', '9506b772-d8df-402a-8ba6-2483528eca65', 'Projects', NULL, '<p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”</p>\n<p>Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.</p>\n<p>Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
(804, 575, 2, 'Projects', '2022-11-26 18:40:17', '2022-11-26 18:40:17', '7362a612-5d68-4223-a48b-ecb4aa7da4e3', 'Projekti', NULL, '<p>\"Tam je stal moški s scenarijem v roki. Pomislil sem, \'To mora biti režiser.\' Rekel sem, \'Kako ti je ime?\' Rekel je: \'To je Christopher Nolan.\' Takoj sem poznal njegovo ime, ker je posnel tri briljantne filme, a so bili majhni. In pomislil sem: \"Oh, to je super. Prosil me bo za enega od teh majhnih filmov in to bo fantastično.\" \' In potem sem rekel: \'Vstopi\' in mu dal skodelico čaja. Rekel sem: \'Kaj je film?\' In rekel je: \'Imenuje se Batman Begins.\' Mislil sem si: \"Prestar sem, da bi igral Batmana, zato sem verjetno butler.\"</p>\n<p>Seveda je imel Nolan prav. Alfred je veliko več kot butler Brucea Wayna, saj igra pomembno vlogo v stripih o Batmanu, ki se je z leti samo razširila. Kot mnogi komični liki je bila tudi njegova zgodovina kar nekajkrat omenjena, a Alfred je že dolgo nadomestni oče ne samo Bruceu, ampak tudi vsem, ki so prevzeli plašč Robina. Je neprecenljiv član družine Bat-Family in iskreno povedano, brez njega bi bili vsi izgubljeni. Pravzaprav je DC Comics pred nekaj leti videl Alfreda, ki ga je umoril Bane, in zagotovo so bili. Eden najbolj pretresljivih trenutkov neverjetne serije \"Nightwing\" Toma Taylorja in Bruna Redonda je Dick Grayson, ki bere Alfredovo pismo po tem, ko je butler umrl. Če ne sledite tej knjigi, takoj pojdite ven in popravite to! Kar zadeva Alfreda, bo le čas pokazal svoje, a vsi vemo, da v stripih nihče zares ne ostane mrtev.</p>\n<p>Preberi več: <a href=\"https://www.slashfilm.com/9433\">https://www.slashfilm.com/9433</a>...</p>', NULL, NULL, NULL, NULL, NULL),
(805, 576, 1, 'Projects', '2022-11-26 18:40:17', '2022-11-26 18:40:17', '0a68466d-51d2-4230-b986-8b507a30e897', 'Projects', NULL, '<p>\"There was a man standing there with a script in his hand. I thought, \'This must be a director.\' I said, \'What\'s your name?\' He said, \'It\'s Christopher Nolan.\' I knew his name immediately because he\'d made three brilliant movies, but they were small. And I thought, \'Oh, this is great. He\'s going to ask me to be in one of these small movies and it\'ll be fantastic.\' And then I said, \'Come in,\' and I gave him a cup of tea. I said, \'Now, what\'s the movie?\' And he said, \'It\'s called Batman Begins.\' I thought to myself, \'I\'m too old to play Batman, so I\'m probably the butler.”</p>\n<p>Of course, Nolan was correct. Alfred is far more than Bruce Wayne\'s butler, playing a major role in Batman comics that has only expanded over the years. Like many comic characters, his history has been retconned quite a few times, but Alfred has long been a surrogate father not only to Bruce, but to everyone who\'s taken up the mantle of Robin as well. He\'s an invaluable member of the Bat-Family and honestly, they would all be lost without him. In fact, DC Comics saw Alfred murdered by Bane a couple of years back and they certainly have been. One of the most poignant moments of the incredible \"Nightwing\" run from Tom Taylor and Bruno Redondo is Dick Grayson reading his letter from Alfred after the butler had passed. If you\'re not keeping up with that book, go out right now and remedy that! As for Alfred, only time will tell, but we all know no one really stays dead in comics.</p>\n<p>Read More: <a href=\"https://www.slashfilm.com/943335/the-unusual-way-christopher-nolan-pitched-batman-begins-alfred-to-michael-caine/?utm_campaign=clip\">https://www.slashfilm.com/9433...</a></p>', NULL, NULL, NULL, NULL, NULL),
